import './App.css';
import Home from './Web/Pages/Home/Home';
import AuthProvider from './Web/Firebase/AuthProvider';
import { BrowserRouter, Route } from 'react-router-dom';
import { Switch } from 'react-router';
import Hedaer from './Web/Shared/Header/Header';
import SignIn from './Web/Pages/Sign In/SignIn';
import SignUp from './Web/Pages/Sign Up/SignUp';
import Reviews from './Web/Pages/Reviews/Reviews';
function App() {
  return (
    <div className="App">
      <AuthProvider>
      <BrowserRouter>
      <Hedaer></Hedaer>
      <Switch>
      <Route exact path="/">
          <Home></Home>
      </Route>
      <Route exact path="/home">
          <Home></Home>
        </Route>
      <Route exact path="/reviews">
          <Reviews></Reviews>
        </Route>
        <Route exact path="/signin">
          <SignIn></SignIn>
        </Route>
        <Route exact path="/signup">
          <SignUp></SignUp>
        </Route>
      </Switch>
      {/* <Footer></Footer> */}
      </BrowserRouter>
      </AuthProvider>
    </div>
  );
}

export default App;
